import "../styles/globals.css";

function MyApp({ Component, pageProps }) {
	return (
		<div className='bg-gradient-to-r from-white-400 via-black-100 to-gray-500'>
			<Component {...pageProps} />
		</div>
	);
}

export default MyApp;
